    [],nt"revision_timestamp": "2016-07-15T04:25:22.458272",nt"name": "unified-medical-language-system-terminology-services-uts-api",nt"isopen":
    false,nt"url": null,nt"notes": "<p>The UTS API is intended for application
    developers to perform Web service calls and retrieve UMLS data within their own
    applications. The UTS API provides the ability to search, retrieve, and filter terms,
    concepts, attributes, relations, metadata and more from over 160 vocabularies of
    the UMLS Metathesaurus, as well as the Semantic Network. Paging, sorting and filtering
    (PSF) capabilities allows users to customize results of Web service calls in many
    ways: choose to include or exclude specific criteria, sort results by fields, or
    specify results displayed per page. The documentation provides a suite of Web Services
    Description Language (WSDL) files, API installation instructions, and sample code.</p>n",nt"license_title":
